import React, { Component } from "react";
import "./styles/main.css";
import Logo from './assets/'

export default class Header extends Component {
  render() {
    return (
      <section className="header">
        <img
          className="header__logo"
          src="{Logo}"
          alt="brainflix logo"
        />
      </section>
    );
  }
}
